(11, 'generate a php web api implementation H1, H2, MetaTitle, Content, MetaKeywords, MetaMisc in json format with double quotes', '{\'H1\': \'\"PHP Web API Implementation\"\', \'H2\': \'\"Creating a Custom API for Your Web Application\"\', \'MetaTitle\': \'\"Creating a Custom API for Your Web Application with PHP\"\', \'Content\': \'\"Creating a custom API allows you to easily access data from your web application without having to rely on third-party services. With PHP, you can easily create a custom API that will allow you to access data from your web application in a variety of formats, such as JSON, XML, and HTML.\"\', \'MetaKeywords\': \'\"PHP, Web, API, Implementation, Data, Access, JSON, XML, HTML\"\', \'MetaMisc\': \'\"Creating a custom API with PHP\"\'}'),
(12, 'generate a Ecommerce consulting H1, H2, MetaTitle, Content, MetaKeywords, MetaMisc in json format', '{\'H1\': \'Ecommerce Consulting Services\', \'H2\': \'Grow Your Online Business with Professional Ecommerce Consulting\', \'MetaTitle\': \'Ecommerce Consulting Services | Professional Ecommerce Advice\', \'Content\': \'Are you looking for professional help to improve your ecommerce business? Our ecommerce consulting services can help you gain insight into the best practices and strategies for growing your online store. We can provide you with advice on everything from web design and marketing to customer service and more. With our expertise, you can be sure that your ecommerce business is as successful as possible.\', \'MetaKeywords\': \'ecommerce consulting, ecommerce advice, ecommerce business, ecommerce services, web design, marketing, customer service\', \'MetaMisc\': \'\'}'),
(13, 'generate a Ecommerce consulting services H1, H2, MetaTitle, Content, MetaKeywords, MetaMisc in json format', '{\'H1\': \'Professional Ecommerce Consulting Services\', \'H2\': \'Maximizing Your Ecommerce Profitability\', \'MetaTitle\': \'Ecommerce Consulting Services | Boost Your Online Store Performance\', \'Content\': \"Are you looking to maximize your ecommerce store\'s profitability? Our experienced team of ecommerce experts can help you develop a comprehensive strategy to improve your online store performance. Our ecommerce consulting services include website design and development, search engine optimization, customer service support, marketing, and more. We understand the challenges of running an online business and can help you overcome them.\", \'MetaKeywords\': \'ecommerce consulting services, ecommerce experts, ecommerce store, website design, search engine optimization, customer service, marketing\', \'MetaMisc\': \'We offer full-service ecommerce consulting services to help you boost your online store performance.\'}'),
(14, 'generate  H1, H2, MetaTitle, Content, MetaKeywords, MetaMisc in json format', '{\'H1\': \'Welcome to our Website\', \'H2\': \'Explore the Latest Trends in Fashion\', \'MetaTitle\': \'Latest Fashions - Shop Now at Our Online Store\', \'Content\': \'Here at our online store, you can find the latest fashion trends in clothing, shoes, accessories, and more. Our selection is always changing, so you can stay ahead of the curve and look your best. Shop now to find your perfect look!\', \'MetaKeywords\': \'Fashion, Clothing, Shoes, Accessories\', \'MetaMisc\': \'Latest styles and trends\'}'),
