(18, 'generate  H1, H2, MetaTitle, Content, MetaKeywords, MetaMisc in json format', '{\'H1\': \'The Benefits of SEO\', \'H2\': \'What is SEO and How Can it Help Your Business?\', \'MetaTitle\': \'What is SEO and How Can it Help Your Business? | The Benefits of SEO\', \'Content\': \'Search engine optimization (SEO) is a strategy for improving the visibility of a website or web page in a search engine’s unpaid results. SEO involves both on-page and off-page strategies that help your website rank higher in the search engine results. The higher your website ranks, the more likely people are to view your content and engage with your business. SEO can help your business stand out from the competition and reach new customers.\', \'MetaKeywords\': \'SEO, Search Engine Optimization, Benefits of SEO\', \'MetaMisc\': \'\'}'),
(19, 'generate  H1, H2, MetaTitle, Content, MetaKeywords, MetaMisc in json format', '{\'H1\': \'The Benefits of Using Natural Cosmetics\', \'H2\': \'Why Natural Cosmetics Are the Best Option for Your Skin\', \'MetaTitle\': \'The Benefits of Natural Cosmetics: Why Natural Is Best for Your Skin\', \'Content\': \'Natural cosmetics are becoming more popular as more people are recognizing the benefits of using natural products. Natural cosmetics are made with natural ingredients, such as plant extracts, essential oils, and minerals, that are gentler on the skin than harsh chemicals. They are also free from synthetic fragrances, dyes, and preservatives, which can irritate and dry out the skin. Natural cosmetics are also more environmentally friendly, as they don’t contain any chemical pollutants. Here are a few of the benefits of using natural cosmetics:\', \'MetaKeywords\': \'natural cosmetics, natural ingredients, skin care, eco-friendly, chemical-free\', \'MetaMisc\': \'\'}'),
